import React from "react";
import {
  Container,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Link,
} from "@mui/material";

interface Questionnaire {
  id: number;
  title: string;
  link: string;
}

const questionnaires: Questionnaire[] = [
  { id: 1, title: "Customer Satisfaction Survey", link: "/questionnaires/1" },
  { id: 2, title: "Product Feedback", link: "/questionnaires/2" },
  { id: 3, title: "Employee Engagement Survey", link: "/questionnaires/3" },
];

const QuestionareSelection: React.FC = () => {
  return (
    <Container>
      <h1>Questionnaires Dashboard</h1>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Title</TableCell>
              <TableCell>Link</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {questionnaires.map((questionnaire) => (
              <TableRow key={questionnaire.id}>
                <TableCell>{questionnaire.id}</TableCell>
                <TableCell>{questionnaire.title}</TableCell>
                <TableCell>
                  <Link href={questionnaire.link} underline="hover">
                    {questionnaire.title}
                  </Link>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Container>
  );
};

export default QuestionareSelection;
